class TreeNode:
    def __init__(self,val):
        self.val =val
        self.left = None
        self.right = None
        self.great_me = 0
        self.geshu=1



def reversePairs(nums):
    """
    :type nums: List[int]
    :rtype: int
    """
    if not nums:
        return 0
    size = len(nums)
    head = TreeNode(nums[0])

    allcount = 0
    for i in range(1,size):
        val = nums[i]
        count = 0
        curnode = head
        while True:
            if val<curnode.val:
                count+=curnode.great_me+curnode.geshu
                if not curnode.left:
                    curnode.left = TreeNode(val)
                    break
                else:
                    curnode = curnode.left
            elif val ==curnode.val:
                count+=curnode.great_me
                curnode.geshu+=1
                break
            else:
                curnode.great_me+=1
                if not curnode.right:
                    curnode.right = TreeNode(val)
                    break
                else:
                    curnode = curnode.right
        allcount +=count
    return allcount


